import React from 'react';

function Country() {

    const Countries = [
        {
           City: 'Ottawa',
           Country: 'Canada'
        },
        {
            City: 'Belgrade',
            Country: 'Serbia'
        },
        {
            City: 'Stockholm',
            Country: 'Sweden'
        }, 
        {
            City: 'Amsterdam',
            Country: 'The Netherlands'
        },
        {
            City: 'Brussels',
            Country: 'Belgium'
        }
    ]


    function pickCountry() {
        var Num = (Math.floor((Math.random() * (Countries.length)-1) + 1));
        const countryOutput = document.getElementById('country');
        countryOutput.innerHTML = Countries[(Num)].City;

    }

    return (
        <>
            <p id="country"></p>
            <button id="button1" onClick={pickCountry}>Click for a new country</button>
            <input id="answer" placeholder="Guess here..."></input>
        </>
    )
}

export default Country;
